import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
	constructor() {
		super();

		this.state = {
			monsters: [
				{
					name: 'Linda'
				},
				{
					name: 'Frank'
				},
				{
					name: 'Jacky'
				}
			]
		};
	}

	render() {
		return <div className='App'>
			<h1>{this.state.monsters[0]}</h1>
		</div>;
	}
}

export default App;
